import React, { useEffect, useState } from 'react'

export const Search = () => {
  const SEARCH_URL = `https://www.googleapis.com/books/v1/volumes?q="coding"`
  const [searchResults, setSearchResults] = useState([])

  useEffect(() => {
    searchBooks()
  }, [])

  const searchBooks = () => {
    fetch(SEARCH_URL)
      .then(res => {
        return res.json()
      })
      .then(books => {
        console.log(books)
        setSearchResults(books)
      })
  }

  return (
    <div className="debug grow">
      <p>Search</p>
      <form>
        <input type="text"></input>
        <button>Search</button>
      </form>
      {
        searchResults.items.map(book => (
          console.log(book)
        ))
      }
    </div>
  )
}
